import { BrowserRouter } from "react-router-dom";

const RouterDom = () => {
  return (
    <BrowserRouter>
      <div>

        <span>Home </span>
        <span>About </span>
        <span>contact</span>
      </div>
    </BrowserRouter>
  );
};

export default RouterDom;

